import React from 'react';
import styled, { css } from 'styled-components';
import { func } from 'prop-types';
import {Flex} from '../../atoms'
import {Links} from '../../molecules';

const BorderFlex = styled(Flex)`
  ${({theme: {sizing} }) => css`
    max-width: ${sizing.mainLinksContainer};
    border-left: 1px solid white; 
  `}
`

const LinkOrganism = ({handleRedirectToPage}) => {
  return(
    <Flex row marginTop='xl8'>
       <Flex column>
           <Links.SideLinks/>
       </Flex>
       <BorderFlex 
          column 
          paddingLeft='pxl14' 
          marginBottom='xl8'
        >
           <Links.MainLinks handleRedirectToPage={handleRedirectToPage}/>
       </BorderFlex>
    </Flex>
  )
};

LinkOrganism.propTypes = {
  handleRedirectToPage: func,
};

export default LinkOrganism;
